import React, {Component} from "react";
import City from "./city.js";
import "./map.scss";


class Map extends Component {
    render() {
        return (
            <div className="map-wrapper">
                <div className="map">
                 <City top="150px" left="230px" name="Warszawa"/>
                 <City top="140px" left="85px" name="Poznań"/>
                 <City top="225px" left="80px" name="Wrocław"/>
                 <City top="180px" left="190px" name="Łódź"/>
                 <City top="285px" left="179px" name="Katowice"/>
                 <City top="295px" left="220px" name="Kraków"/>
                 <City top="15px" left="150px" name="Trójmiasto"/>
                 <City top="75px" left="15px" name="Szczecin"/>
                 <City top="50px" left="300px" name="Białystok"/>
                 <City top="300px" left="300px" name="Rzeszów"/>
                </div>
            </div>
        )
    }
}

export default Map;
